import React from 'react';
import Navbar from './components/navbar';
import GamifiedLayout from './components/GamifiedLayout';
import Footer from './components/footer';

function App() {
  return (
    <>
      <Navbar />
      <GamifiedLayout />
      <Footer />
    </>
  );
}

export default App;
